#include <string>
using namespace std;

vector<int> parse_nested_parens(string paren_string) {
    vector<int> result;
    size_t start = 0;
    while (start < paren_string.size()) {
        size_t end = paren_string.find(' ', start);
        if (end == string::npos) {
            end = paren_string.size();
        }
        string group = paren_string.substr(start, end - start);
        int depth = 0;
        int max_depth = 0;
        for (char c : group) {
            if (c == '(') {
                depth++;
                max_depth = max(max_depth, depth);
            } else if (c == ')') {
                depth--;
            }
        }
        result.push_back(max_depth);
        start = end + 1;
    }
    return result;
}

