int how_many_times(string str, string substring) {
    int times = 0;
    for (int i = 0; i <= str.length() - substring.length(); i++) {
        if (str.substr(i, substring.length()) == substring) {
            times++;
        }
    }
    return times;
}

#undef NDEBUG
#include<assert.h>
