using namespace std;

vector<int> factorize(int n) {
    vector<int> fact;
    int i = 2;
    while (i <= sqrt(n) + 1) {
        if (n % i == 0) {
            fact.push_back(i);
            n /= i;
        } else {
            i += 1;
        }
    }
    if (n > 1) {
        fact.push_back(n);
    }
    return fact;
}

