using namespace std;

string sort_numbers(string numbers) {
    map<string, int> value_map = {
        {"zero", 0},
        {"one", 1},
        {"two", 2},
        {"three", 3},
        {"four", 4},
        {"five", 5},
        {"six", 6},
        {"seven", 7},
        {"eight", 8},
        {"nine", 9}
    };

    vector<string> words;
    string word;
    for (char c : numbers) {
        if (c == ' ') {
            words.push_back(word);
            word.clear();
        } else {
            word += c;
        }
    }
    words.push_back(word);

    sort(words.begin(), words.end(), [&value_map](const string& a, const string& b) {
        return value_map[a] < value_map[b];
    });

    string result;
    for (const string& word : words) {
        result += word + " ";
    }
    result.pop_back(); // remove trailing space

    return result;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (sort_numbers("") == "");
    assert (sort_numbers("three") == "three");
    assert (sort_numbers("three five nine") == "three five nine");
     assert (sort_numbers("five zero four seven nine eight") == "zero four five seven eight nine");
      assert (sort_numbers("six five four three two one zero") == "zero one two three four five six");
}

