bool is_prime(int p) {
    if (p < 2) return false;
    for (int k = 2; k <= std::sqrt(p); k++) {
        if (p % k == 0) return false;
    }
    return true;
}

int prime_fib(int n) {
    int f1 = 0, f2 = 1;
    int count = 0;
    while (true) {
        int f3 = f1 + f2;
        f1 = f2;
        f2 = f3;
        if (is_prime(f2)) {
            count++;
            if (count == n) return f2;
        }
    }
}

