vector<float> sort_even(vector<float> l){
    vector<float> evens;
    vector<float> odds;
    for (int i = 0; i < l.size(); i++) {
        if (i % 2 == 0) {
            evens.push_back(l[i]);
        } else {
            odds.push_back(l[i]);
        }
    }
    sort(evens.begin(), evens.end());
    vector<float> ans;
    for (int i = 0; i < max(evens.size(), odds.size()); i++) {
        if (i < evens.size()) {
            ans.push_back(evens[i]);
        }
        if (i < odds.size()) {
            ans.push_back(odds[i]);
        }
    }
    return ans;
}

