bool is_prime(int k) {
    if (k < 2) {
        return false;
    }
    for (int i = 2; i <= sqrt(k); i++) {
        if (k % i == 0) {
            return false;
        }
    }
    return true;
}

int largest_prime_factor(int n) {
    int largest = 1;
    for (int j = 2; j <= sqrt(n); j++) {
        while (n % j == 0) {
            if (is_prime(j)) {
                largest = max(largest, j);
            }
            n /= j;
        }
    }
    if (n > 1 && is_prime(n)) {
        largest = max(largest, n);
    }
    return largest;
}

#undef NDEBUG
#include<assert.h>
