string encode(string message) {
    string vowels = "aeiouAEIOU";
    string encodedMessage = "";
    for (char c : message) {
        if (isalpha(c)) {
            // Swap case
            c = islower(c) ? toupper(c) : tolower(c);
            // Replace vowels
            if (vowels.find(c) != string::npos) {
                int offset = islower(c) ? 'a' : 'A';
                c = (c - offset + 2) % 26 + offset;
            }
        }
        encodedMessage += c;
    }
    return encodedMessage;
}

