int closest_integer(string value) {
    float num = stof(value);
    if (value.find('.') != string::npos && value.substr(value.find('.') + 1) == "5") {
        if (num > 0) {
            return ceil(num);
        } else {
            return floor(num);
        }
    } else {
        return round(num);
    }
}

