vector<string> words_string(string s) {
    string temp = "";
    vector<string> result;

    for (char c : s) {
        if (c == ',' || c == ' ') {
            if (!temp.empty()) {
                result.push_back(temp);
                temp = "";
            }
        } else {
            temp += c;
        }
    }

    if (!temp.empty()) {
        result.push_back(temp);
    }

    return result;
}

