vector<int> unique_digits(vector<int> x){
    vector<int> odd_digit_elements;
    for (int i : x) {
        bool all_odd = true;
        int temp = i;
        while (temp > 0) {
            if (temp % 10 % 2 == 0) {
                all_odd = false;
                break;
            }
            temp /= 10;
        }
        if (all_odd) {
            odd_digit_elements.push_back(i);
        }
    }
    sort(odd_digit_elements.begin(), odd_digit_elements.end());
    return odd_digit_elements;
}

