vector<string> reverse_delete(string s, string c) {
    string result = "";
    for (char ch : s) {
        if (c.find(ch) == string::npos) {
            result += ch;
        }
    }
    bool isPalindrome = true;
    int i = 0, j = result.size() - 1;
    while (i < j) {
        if (result[i] != result[j]) {
            isPalindrome = false;
            break;
        }
        i++;
