int count_nums(vector<int> n) {
    int count = 0;
    for (int num : n) {
        int sum = 0;
        int sign = (num < 0) ? -1 : 1;
        num = abs(num);
        while (num > 0) {
            int digit = num % 10;
            sum += (digit * sign);
            sign = 1; // reset sign for subsequent digits
            num /= 10;
        }
        if (sum > 0) {
            count++;
        }
    }
    return count;
}

