bool move_one_ball(vector<int> arr) {
    if (arr.empty()) {
        return true;
    }

    vector<int> sorted_arr = arr;
    sort(sorted_arr.begin(), sorted_arr.end());

    int min_value = *min_element(arr.begin(), arr.end());
    int min_index = distance(arr.begin(), find(arr.begin(), arr.end(), min_value));

    vector<int> shifted_arr(arr.size());
    copy(arr.begin() + min_index, arr.end(), shifted_arr.begin());
    copy(arr.begin(), arr.begin() + min_index, shifted_arr.begin() + arr.size() - min_index);

    return shifted_arr == sorted_arr;
}

