long long minSubArraySum(vector<long long> nums) {
    long long max_sum = 0;
    long long s = 0;
    for (long long num : nums) {
        s += -num;
        if (s < 0) {
            s = 0;
        }
        max_sum = max(s, max_sum);
    }
    if (max_sum == 0) {
        max_sum = *max_element(nums.begin(), nums.end(), [](long long a, long long b) {
            return -a < -b;
        });
    }
    return -max_sum;
}

