    for (char c : s) {
        if (c == ' ') {
            if (!word.empty()) {
                int n_consonants = 0;
                for (char ch : word) {
                    if (ch != 'a' && ch != 'e' && ch != 'i' && ch != 'o' && ch != 'u' &&
                        ch != 'A' && ch != 'E' && ch != 'I' && ch != 'O' && ch != 'U') {
                        n_consonants++;
                    }
                }
                if (n_consonants == n) {
                    result.push_back(word);
                }
                word.clear();
            }
        } else {
            word += c;
        }
    }
    // Check the last word
    if (!word.empty()) {
        int n_consonants = 0;
        for (char ch : word) {
            if (ch != 'a' && ch != 'e' && ch != 'i' && ch != 'o' && ch != 'u' &&
                ch != 'A' && ch != 'E' && ch != 'I' && ch != 'O' && ch != 'U') {
                n_consonants++;
            }
        }
        if (n_consonants == n) {
            result.push_back(word);
        }
    }
    return result;
}

