using namespace std;

bool valid_date(string date) {
    // Check if date string is not empty
    if (date.empty()) {
        return false;
    }

    // Split date string into month, day, and year
    size_t pos1 = date.find('-');
    size_t pos2 = date.find('-', pos1 + 1);
    if (pos1 == string::npos || pos2 == string::npos) {
        return false;
    }

    string monthStr = date.substr(0, pos1);
    string dayStr = date.substr(pos1 + 1, pos2 - pos1 - 1);
    string yearStr = date.substr(pos2 + 1);

    // Convert month, day, and year to integers
    int month, day, year;
    try {
        month = stoi(monthStr);
        day = stoi(dayStr);
        year = stoi(yearStr);
    } catch (const invalid_argument& e) {
        return false;
    }

    // Check if month is within valid range
    if (month < 1 || month > 12) {
        return false;
    }

    // Check if day is within valid range for given month
    if (month == 2) {
        if (day < 1 || day > 29) {
            return false;
        }
    } else if (month == 4 || month == 6 || month == 9 || month == 11) {
        if (day < 1 || day > 30) {
            return false;
        }
    } else {
        if (day < 1 || day > 31) {
            return false;
        }
    }

    return true;
}

