bool is_nested(string str) {
    vector<int> opening_bracket_index;
    vector<int> closing_bracket_index;
    for (int i = 0; i < str.length(); i++) {
        if (str[i] == '[') {
            opening_bracket_index.push_back(i);
        } else {
            closing_bracket_index.push_back(i);
        }
    }
    int cnt = 0;
    int i = 0;
    int l = closing_bracket_index.size();
    for (int idx : opening_bracket_index) {
        if (i < l && idx < closing_bracket_index[l - i - 1]) {
            cnt++;
            i++;
        }
    }
    return cnt >= 2;
}

