string file_name_check(string file_name){
    string suf[] = {"txt", "exe", "dll"};
    size_t dot_pos = file_name.find('.');
    if (dot_pos == string::npos || dot_pos == 0 || dot_pos == file_name.length() - 1) {
        return "No";
    }
    string suffix = file_name.substr(dot_pos + 1);
    bool valid_suffix = false;
    for (int i = 0; i < 3; i++) {
        if (suffix == suf[i]) {
            valid_suffix = true;
            break;
        }
    }
    if (!valid_suffix) {
        return "No";
    }
    string name = file_name.substr(0, dot_pos);
    if (!isalpha(name[0])) {
        return "No";
    }
    int digit_count = 0;
    for (int i = 0; i < name.length(); i++) {
        if (isdigit(name[i])) {
            digit_count++;
        }
    }
    if (digit_count > 3) {
        return "No";
    }
    return "Yes";
}

