int digits_sum(int n) {
    int sum = 0;
    int neg = 1;
    if (n < 0) {
        n = -n;
        neg = -1;
    }
    while (n > 0) {
        sum += neg * (n % 10);
        n /= 10;
        neg = 1;
    }
    return sum;
}

bool compare(int a, int b, vector<int>& nums) {
    int sumA = digits_sum(a);
    int sumB = digits_sum(b);
    if (sumA == sumB) {
        return nums[a] < nums[b];
    }
    return sumA < sumB;
}

vector<int> order_by_points(vector<int> nums) {
    vector<int> indices(nums.size());
