    sort(indices.begin(), indices.end(), [&](int a, int b) {
        return compare(nums[a], nums[b], nums);
    });
    vector<int> result;
    for (int i = 0; i < indices.size(); i++) {
        result.push_back(nums[indices[i]]);
    }
    return result;
}

