    vector<string> planet_names = {"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"};
    vector<string> result;

    // Check if both planet names are valid
    bool planet1_found = false;
    bool planet2_found = false;
    int planet1_index = -1;
    int planet2_index = -1;
    for (int i = 0; i < planet_names.size(); i++) {
        if (planet_names[i] == planet1) {
            planet1_found = true;
            planet1_index = i;
