string find_max(vector<string> words) {
    string max_word = words[0];
    int max_unique = 0;
    for (const string& word : words) {
        set<char> unique_chars(word.begin(), word.end());
        int num_unique = unique_chars.size();
        if (num_unique > max_unique || (num_unique == max_unique && word < max_word)) {
            max_word = word;
            max_unique = num_unique;
        }
    }
    return max_word;
}

