vector<int> parse_music(string music_string) {
    map<string, int> note_map = {{"o", 4}, {"o|", 2}, {".|", 1}};
    vector<int> result;
    size_t pos = 0;
    while (pos < music_string.size()) {
        string note;
        if (music_string[pos] == 'o') {
            if (pos + 1 < music_string.size() && music_string[pos + 1] == '|') {
                note = "o|";
                pos += 2;
            } else {
                note = "o";
                pos += 1;
            }
        } else if (music_string[pos] == '.') {
            note = ".|";
            pos += 2;
        }
        result.push_back(note_map[note]);
    }
    return result;
}

